import React, {useState, useEffect} from 'react'
import axios from 'axios'

const Coin = () => {

    const [Coin, setCoin] = useState({})

    const url = `https://api.coingecko.com/api/v3/coins/bitcoin`

    useEffect(() => {
        axios.get(url).then((res) => {
            setCoin(res.data)
        }).catch((error) => {
            console.log(error)
        })
    })
  return (
    <div>
      <h1></h1>
    </div>
  )
}

export default Coin
